import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchDataAction } from "../../Redux/Actions";

const TodaysMatchResults = () => {
  const data = useSelector(
    (state) =>
      state.fetchDataReducer &&
      state.fetchDataReducer[
        "https://api.jsonbin.io/b/5edaad9e2f5fd957fda48c88?test"
      ]
  );

  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(
      fetchDataAction({
        url: "https://api.jsonbin.io/b/5edaad9e2f5fd957fda48c88?test",
      })
    );
  }, [dispatch]);

  console.log("hayy");

  return <div>yoyoyo</div>;
};
export default TodaysMatchResults;
